VALUES ('7610200062413', 'Studentenfutter Sun Queen', 'Trockenfrucht-Nuss-Mischung. Zutaten: Sultaninen (mit Baumwollsamenöl, Sonnenblumenöl), Sultaninen hell (mit Sonnenblumenöl, Antioxidationsmittel: Schwefeldioxid), Cashewkerne, Haselnüsse, Mandeln, Pinienkerne, Pecannüsse. Kann reste anderer Schalenfrüchte (Nüsse) und Erdnüsse enthalten. Mélange de fruits sechés et de noix. Ingrédients: raisins secs (avec huile de coton, huile de tourieso raisins secs blond (avec huile de tournesol, antioxygène: dioxyde de soufre), noix de cajouoisettes, amandes, pignons, no de pécan. Pe contenir d\'autres fruits à coque (noix) et des arachides. Miscela di frutta secca e noci.Ingredienti: uva sultanina (con olio di semi di cotone, olio di girasole), uva sultanina bian (con olio di girasole, antiossidante: iossido di zolfc), noci di anacardi, nocciole, mandorle, pinoli, noci d pecan contenere altra frutta a suscio (noci) ed arachidi. Trotz sorgfältiger Verarbeitung kann das Produkt Schalenteile enthaten Malgré tout le soin apporte elaboration, ce produit peut contenir des fragments de coques. | Non stante !! prodotto venga sptopos lavorazione attenta, ess può contenere pezzi di guscio. Trocken aufbewahrend vor wärme schützen. | A conserver au sec et à l\'abri de la cleur./Co all\'asciutto ed al riparo alre.', 'https://static.openfoodfacts.org/images/products/761/020/006/2413/front_en.15.400.jpg', '23', '2', '52', '39', '6', '8', '0.03', '0.0118110236220472', '', '0');

